import React, { Component } from 'react'
import firebase from '../utils/firebase'
import '../App2.css'
import Sound from 'react-sound';

function Data({ data }) {

    return (
        <div className="stu">
            {data.name + " อ." + data.class + " เลขที่ " + data.number}
            <Sound
                url="https://firebasestorage.googleapis.com/v0/b/kidozprc2021.appspot.com/o/%E0%B8%81%E0%B8%8A%E0%B8%9E%E0%B8%A3_%E0%B8%81%E0%B8%B1%E0%B8%99%E0%B8%97%E0%B8%A1%E0%B8%B2%E0%B9%82%E0%B8%99%E0%B8%8A.mp3?alt=media&token=6b6b6cf6-160d-4885-9172-83fb16c4a784"
                playStatus={Sound.stauts.PLAYING}
                onLoading={this.handleSongLoading}
                onPlaying={this.handleSongPlaying}
                onFinishedPlaying={this.handleSongFinishedPlaying}
            />
        </div>
    )
}

export default Data;
